import React from "react";
import { GetValues} from './GetValues.js';

/*
export function DropdownElement(props) {
    return (
        <div>
            <select>
                <option> {props.label} </option>
                <option> Diameter </option>
            </select>
        </div>
    );
}
*/

export function DropdownElement(props) {
    lengths = GetValues(props.label);
    return (
        <div>
            <select>
            {lengths.map((length) => (
                <option> {length.Length} </option>
                ))};
            </select>
        </div>
    );
}
